`,r:{minutes:3.37,words:1010},y:"a",t:"【金門金城】茅山塔、茅山、天后宮"},["/posts/post-144-2013-09-23","/posts/post-144-2013-09-23.md"]],["v-c5a1e724","/posts/post-145-2013-09-23.html",{d:13798944e5,l:"September 23, 2013",c:["金門上山走走","小百岳"],v:"https://1013399.github.io/image-3/145/344771439_l.jpg",e:`<p><strong>太武山</strong>位於金門東半島中部，雄偉莊嚴，由於其形狀有如武士的帽，故以太武山為名。海拔高度253公尺，為金門第一高峰。越江遠望，山形蜿蜒，若仙人倒地之狀，故云：「浯江斷嶼入海水，仙人倒地臥不起。」因此太武山別稱仙山，俗稱大山。</p>
<p>(資料來源：<a href="http://tour.kinmen.gov.tw/chinese/trip_detail.aspx?sn=22&amp;n=10474" target="_blank" rel="noopener noreferrer">金門觀光旅遊網</a>)</p>
